// src/components/Sidebar.js
import React from 'react';
import './Sidebar.css';
import { Link } from 'react-router-dom';


const Sidebar = () => {
  return (
    <div className="sidebar">
      <div className="sidebar__item">
        <h2>Student Details</h2>
      </div>
      <div className="sidebar__item">
        <h2>Create a Test</h2>
      </div>
      <div className="sidebar__item">
      <Link to={'/'} ><h2>close</h2></Link> 
      </div>
    </div>
  );
};

export default Sidebar;
